Synopsis

Set in Edo period, Japan, a women risks her life to keep her true love.

Ito (Keiko Kitagawa), daughter of a clan official, encounters Magoshiro Eguchi (Shuntaro Miyao). Magoshiro is a low ranking samurai sparks an attraction with Ito.
Ito challenges Magoshiro to a sword match using bamboo sticks. Mahoshiro accepts. The pair's duel causes sparks to fly an attraction from both sides.

Meanwhile, Ito faces an arranged marriage with Saisuke Katagiri (Masahiro Komoto) and Magoshiro is with Kayo (Ayumi Ito) ...


